import React from 'react';
import Game from '../Game';
import styled from 'styled-components';

function App() {
  return (
    <div className='App'>
      <h1>World of Wrestling!!</h1>
      <Game />
    </div>
  );
}

const AppBody = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export default App;
